TITLE:
  - Framework test for multiphase flow through elastic porous medium.
  - Monolithic algorithm
  - Basically a 3D extension of the 2D input-file poromultielast_2D_quad4_mono.dat
  - Also locsys functionality is tested by simply rotating the DVOL
  - condition 90 degree around the global Z-axis
